import  axios  from "axios"

import {ADD,REMOVE,SEARCH,TEMPS,ORDER,FILTER} from "./Action-type"

export const AddDog = function (name){
    return (dispatch)=>{
    axios.get(`http://localhost:3001/getDogs/?name=${name}`)
  .then(({data}) =>{ console.log(data)
    return dispatch ({
    type: SEARCH,
    payload:data
  })

})

}
}

export const AddAllDogs = function (){
  return (dispatch)=>{
  axios.get(`http://localhost:3001/getAllDogs/`)
.then(({data}) =>{ console.log(data)
  return  dispatch({
  type: ADD,
  payload:data
})

})

}
}


export const getTemps = function (){
  return (dispatch)=>{
  axios.get(`http://localhost:3001/getTemp/`)
.then(({data}) =>{ console.log(data)
  return  dispatch({
  type: TEMPS,
  payload:data
})

})

}
}

export function FilterDogs(Temperament) {
  return {
    type: FILTER,
    payload: Temperament
  }
}

export function OrderDog(order) {
  return {
    type: ORDER,
    payload: order
  }
}
